import { Box, Card, Container, Grid, Typography } from "@mui/material";

const Contact = () => {
  return (
    <Container sx={{ py: 6 }}>
      <Typography
        variant="h2"
        sx={{
          textAlign: "center",
          color: "#f99f00",
          mb: 4,
          fontWeight: "bold",
        }}
      >
        Contactanos
      </Typography>
      <Grid container gap={1} justifyContent="space-around">
        <Grid item xs={12} md={6}>
          <Card elevation={5} sx={{ minWidth: 120 }}>
            <Box component="form">

            </Box>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Contact;
